import React from 'react';
import './App.css';
import RegulationCheckComponent from "./components/regulationCheckComponent/RegulationCheckComponent";
import OverviewComponent from "./components/overviewComponent/OverviewComponent";
import DashboardComponent from "./components/dashboardComponent/DashboardComponent";
import { BrowserRouter as Router, Route , Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App page-container">
            <div className=" content-wrap">
              <NavbarComponent />
              <Switch>

                  <Route path="/regulation-check" component={RegulationCheckComponent} />
                  <Route path="/dashboard" component={DashboardComponent} />

                  <Route path='/shopping-cart/:id' component={PresenterCartComponent} />
                  <Route path="/user" component={UserLoginComponent} />
                  <Route path="/error" component={ErrorPage} />
                  <Route exact path='/register-user' component={UserRegisterComponent} />
                  <Route exact path='/settings-user' component={UserSettingsComponent} />
                  <Route path="/" component={Home} /> 
              </Switch>
            </div>
            <FriendMenu />
          <Footer />
          </div>

    <div className="App">
        <RegulationComponent />
    </div>
    </Router>
  );
}

export default App;
